import React from 'react';

function Menu({ onMenuClick }) {
  return (

    <div>

      <h2>Men√∫</h2>
      <div div class="btn-group" role="group" aria-label="Basic example">
      <button class="btn btn-primary" onClick={() => onMenuClick('crear')}>Crear Riesgo</button>
      <button class="btn btn-primary" onClick={() => onMenuClick('eliminar')}>Eliminar Riesgo</button>
      <button class="btn btn-primary" onClick={() => onMenuClick('modificar')}>Modificar Riesgo</button>
      <button class="btn btn-primary" onClick={() => onMenuClick('ver')}>Ver Riesgos</button>
    </div>
    </div>
  );
}

export default Menu;
